var tipuesearch = {"pages": [{'title': 'About', 'text': 'W1-W5 \n W6-W9 \n W10-W14 \n W15-W18 \n', 'tags': '', 'url': 'About.html'}, {'title': 'W1-W5', 'text': 'w1 . 建立個人倉儲cd2020及進行每週網站管理 \n w2. \xa0\xa0 重新創建python3.8.2隨身系統 \n \n \xa0 pyhton網站https://www.python.org/，下載3.8.2版本 \xa0 \n 完成後開啟，點選Customize installation(定制) \xa0 \n 把pip選項取消，接著案next到py382 \xa0 \n 下載SciTE系統full 64-bit download，下載完成後解壓縮至data下的wscite432 \xa0 \n 下載PortableGit 64-bit Git for Windows Portable 至portablegit下。 \xa0 \n 用編輯器開啟start_mdecourse.bat檔案 \xa0 \n 在y槽執行python git-pip.py  \xa0 \n 安裝軟件包 \n \n w3. \n \n   隨機分組 \n \n (1)random.shuffle的語法 \n random.shuffle（ x ，随機）使用方法 \n \n \n 2.抽點名 \n import random\n\nnumber_list = [7,14,21,28,35,42,49,56,63,70] #學生名單\n\nX = 3 #抽點人數\n\nprint(random.sample(number_list,X)) #顯示抽點結果 \n PDF \n w4 \n 第三組第一次直播會議 \n \n \n \n 翻譯 http://www.coppeliarobotics.com/helpFiles/index.htm \n 下載PDF連結: \n https://drive.google.com/open?id=1QQAyqm9VjunnozFMYdrV4K7ktpkjgVOu \n \n w5\xa0 清明節放假 \n', 'tags': '', 'url': 'W1-W5.html'}, {'title': 'W6-W9', 'text': 'w6 \n 第三組第二次直播會議 \n \n 作業二: \n \n 根據主題 0 和主題 1 的素材，您能否具體描述機械設計團隊為了完成作業 1 的四輪機器人需要做些什麼 ? \n 您需要從 https://cyberbotics.com/doc/guide/index 了解什麼來實現四輪機器人？ \n \n w7\xa0 \n 4-8尺寸與公差 \n w8 \n 解決python 3.8.2版本leo閃退問題 1.輸入pip list，檢查leo版本是否為6.1版本(是的話即輸入pip uninstall leo 將此版本刪除) 2.接著輸入pip install leo==6.2.1指定leo 6.2.1版本，即可正常運作。 \n V-rep更新版本 \n 1.進入CoppliaSim 官方網站: https://www.coppeliarobotics.com/ \n \n 2.進入download 中下載教育版 \n 3.下載 CoppeliaSim Edu Binaries 可攜版本 \n 4.完成上述步驟即可刪除原本的V rep \n \n w9 \n 期中考線上課程 \n 1.藉由行事曆 建立 Google Handout Meet\xa0 \n 2.開放live至少10分鐘，進行個人操作，且錄製。 \n 3.將錄製檔存於個人 Google Drive 中的期中簡報 mp4 影片，並共享給@gm之所有用戶 \n \n', 'tags': '', 'url': 'W6-W9.html'}, {'title': 'W10-W14', 'text': 'Week10 \n 第三組第三次直播會議 \n \n \n 開會紀錄PDF連結: https://drive.google.com/open?id=1AP49O_JYqgqQNDzEz7Pxj-tzjugL8Bb2 \n 作業三 : 根據對 Topic2 和 Topic3 的閱讀，使用 CoppeliaSim 、 Webots 、 Onshap e 提出一個機電一體化項目。 \n \n Week11 \n gm用戶登入設置 \n 1.登錄學校的個人gm信箱,到\xa0 https://console.developers.google.com \xa0網站。 \n 2.建立專案，自行設定專案名稱。 \n 3.git clone\xa0 cd2020pj1倉儲，放在Y/tmp下。 \n 4.至api設定頁面點選啟用API和服務，並點選Google+ Domains API。 \n 5.點選憑證設定同意畫面，選擇內部建立，設定名稱後儲存。 \n 6.建立憑證及oauth用戶端id。選擇網路應用程式後建立。 \n 7.產生的id跟密碼要儲存在編輯器，存為oauth_s個人學號.txt \n 8.設定來源跟導向的URl，來源設定為 https://localhost:8443，導向設定為\xa0 https://localhost:8443/login/google/ \xa0，後儲存。 \n 9.開啟先前clone cd2020pj1的leo，將key file的open都命名為oauth_s個人學號.txt，接著點選ROC\xa0。 \n 10.開啟編輯器打入 pip install authomatic，需用新版python \n 11.即可開啟近端 \n 第四次小組會議 \n \n \n 第四次因事未到 \n Week12 \n 第五次小組會議 \n \n \n 開啟ubuntu \n 1.點入 \n \n 2.勾選下面3個選項 點擊IMPROVE \n \n \n \n 3.進入畫面 \n \n 4.點擊START就可以開始編輯程式 \n \n Ubuntu設定及API連線 \n 1.下載 vitualbox 、 ubuntu 、 CoppeliaSim 四輪車控制器檔案。 \n 2.開啟vitualbox，匯入ubuntu。 \n 3.設定虛擬主機的網路埠號，連接埠轉送->設定三個埠號(22、8443、19999) \n 4.完成即可啟用，輸入密碼kmol2020，接著開啟lxterminal。 \n 5.隨步驟打開coppeliasim，cd coppeliasim4_rev4->ls->cd CoppeliaSim_Edu_v4_0_0_Ubuntu18_04->ls->./coppeliaSim.sh，接著打開sdc.ttt。 \n 6.開啟CoppeliaSim將car_model.py放入編譯器中，接著執行 \n 7.開始模擬四輪車旋轉 \n \n 作業三 \xa0 TOPIC2-PDF \n \n Week13 \n \n IPv4 遠端控制設定 \n 1.開啟cmd命令窗 \n 2.輸入ipconfig來取得IPv4的IP \n 3.將虛擬主機的埠號中IP改為個人查得之IP \n 4.啟動Ubuntu並開啟XLaunch.exe \n 5.開啟putty，並輸入遠端連線之IP \n 6.將Enable X11 fowarding打勾並在X display location中輸入localhost:0.0 \n 7.儲存後啟動,帳號及密碼輸入kmol2020 \n 8.輸入xterm&，並進入cd2020pj1 \n 9.進入docs及cmsimde \n 10.輸入vi wsgi.py編輯 \n 11.將近端的host改為10.0.2.4, 按Esc並輸入:wq存檔。 \n 12.TMP下輸入python3 wsgi.py，網址為該主機IP加上17443 \n Week14 \n W14抽點網站: http://mde.tw/cdbw14-1 \n FileZilla \n FileZilla是一個 免費軟件 ， 跨平台 \xa0 FTP 應用程序，由FileZilla Client和FileZilla Server組成。客戶端二進製文件可用於 Windows ， Linux 和 macOS ，服務器二進製文件僅可用於Windows。服務器和客戶端都支持 FTP 和 FTPS ，而客戶端還可以連接到 SFTP 服務器。 \n', 'tags': '', 'url': 'W10-W14.html'}, {'title': 'W15-W18', 'text': 'Week15 \n W15抽點網站: http://mde.tw/cdbw15-3 \n Week16 \n IPv6對外連線個人倉儲 \n 1.修改IPv6網路設定 \n \n 2.開啟虛擬主機，輸入密碼kmol2020 \n 3.開啟Lxterminal，在tmp下clone個人倉儲 \n 4.輸入ifconfig查詢IPv6的地址 \n 5.輸入sudo vi wsgi.py,將host改為IPv6地址 \n \n 6.完成後存儲，並輸入python3 wsgi.py啟動 \n Week18 \n 1. FINAL Project \xa0(連結) \n 2.個人reveal \n 3.期末報告影片 \n \xa0 \n \n \n Develop \n', 'tags': '', 'url': 'W15-W18.html'}]};